var tipuesearch = {"pages":[{"title":"About Bg6","url":"./pages/about-bg6/","tags":"misc","text":"2016Fallcadpb_bg6 成員簡報 組長 40423206 組員 40423214 組員 40423216 組員 40423224 組員 40423226 組員 40423229 2016Fallcadpb_bg6 成員網誌 組長 40423206 組員 40423214 組員 40423216 組員 40423224 組員 40423226 組員 40423229"},{"title":"2016 Fall 電腦輔助設計與實習期末自評總結","url":"./2016-fall-dian-nao-fu-zhu-she-ji-yu-shi-xi-qi-mo-zi-ping-zong-jie.html","tags":"Misc","text":"期末總結心得 這學期學了很多新軟體從3D-2D就連影片錄製也學了新的感到充實。 也曾增強了環境的重要性，程式指令還有一些資料整理觀念都更強化了， 再最後一堂課好在有老師的提醒才發現我在某些部分出了問題，所以我們這組有重新創了一個倉儲， 重新把作業編排成老師要的方式，此外這堂課讓我學到的是團隊合作，很開心遇到這些組員， 大家的配合，讓我們能夠順利的完成每次的作業，也要謝謝老師介紹新的繪圖軟體給我們 onshape的很好用。"},{"title":"連桿組裝  W16","url":"./lian-gan-zu-zhuang-w16.html","tags":"Misc","text":"40423203onshape連桿組裝 from 40423203 on Vimeo . 心得:再組合時點跟點之間有時候點到別的地方就會整個重疊 有些點太隱密不太好點"},{"title":"四連桿運動模擬 w15 :","url":"./si-lian-gan-yun-dong-mo-ni-w15.html","tags":"Misc","text":"40423203Linkages (fourbar & multilink) (四連桿與多連桿運動模擬) from 40423203 on Vimeo . 將所得到的點座標 .csv 以 Excel 畫圖, 得到:"},{"title":"week5 W14","url":"./week5-w14.html","tags":"Misc","text":"上課內容 複習了之前的一些指令 和整理了資料用一些時間來作小組作業 小組作業week5"},{"title":"網頁問題 week4 w13","url":"./wang-ye-wen-ti-week4-w13.html","tags":"Misc","text":"網頁更新問題 這幾次推送在設定那裡都會出 The tag notebook on line 13 in plugin/liquid_tags/test_data/content/test-ipython-notebook-nbformat3.md is not a recognized Liquid tag. 好像是因為有資料無法更新造 成我們推送出去的資料無!法在 遠端顯示 所以只要把不能更新的資料夾 刪除再送回去就解決問題惹!"},{"title":"Solvespace 組合圖 w12","url":"./solvespace-zu-he-tu-w12.html","tags":"Misc","text":"Solvespace 組合圖 心得:在組合時有時候都會因為一點點的誤差 而造成整個正方體歪掉而要重新組裝"},{"title":"week3 校慶 w11","url":"./week3-xiao-qing-w11.html","tags":"Misc","text":"校慶 學校生日放假一天"},{"title":"平面四連桿機構模擬 w10","url":"./ping-mian-si-lian-gan-ji-gou-mo-ni-w10.html","tags":"Misc","text":"Solvespace 平面四連桿機構模擬 將所得到的點座標的.csv以Excel的畫圖，得到： 首先利用 Brython, 讀取40423203目錄中的 40423203.csv 座標檔案, 然後以 splitlines() 及 split() 取出各點的 x 座標與 y 座標後, 將點連成路徑曲線如下: window.onload=function(){ brython(1); } from browser import document as doc from browser import html import math # 準備繪圖畫布 canvas = doc[\"fourbar\"] container1 = doc['container1'] ctx = canvas.getContext(\"2d\") fourbar_data = open(\"./../w7/11117.csv\").read() fourbar_list = fourbar_data.splitlines() #container1 <= fourbar_list[0] # 以下可以利用 ctx 物件進行畫圖 # 先畫一條直線 ctx.beginPath() # 設定線的寬度為 1 個單位 ctx.lineWidth = 1 # 利用 transform 將 y 座標反轉, 且 offset canvas.height # (X scale, X skew, Y skew, Y scale, X offset, Y offset) # 配合圖形位置進行座標轉換 ctx.transform(1, 0, 0, -1, canvas.width/2+250, canvas.height/2+100) # 畫出 x 與 y 座標線 # 各座標值放大 8 倍 ratio = 8 ''' ctx.moveTo(0, 0) ctx.lineTo(0, 100) ctx.moveTo(0, 0) ctx.lineTo(100, 0) ''' ctx.moveTo(0, 0) ctx.lineTo(-30*ratio, 0) start_point = fourbar_list[0].split(\",\") ctx.moveTo(float(start_point[0])*ratio, float(start_point[1])*ratio) count = 0 for data in fourbar_list[1:]: point = data.split(\",\") #count = count + 1 #container1 <= str(count) + \":\" + point[0] + \",\" + point[1] #container1 <= html.BR() ctx.lineTo(float(point[0])*ratio, float(point[1])*ratio) # 設定顏色為藍色, 也可以使用 \"rgb(0, 0, 255)\" 字串設定顏色值 ctx.strokeStyle = \"blue\" # 實際執行畫線 ctx.stroke() ctx.closePath()"},{"title":"找連結 w9","url":"./zhao-lian-jie-w9.html","tags":"Misc","text":"到老師的連結看看自己學號的連結是否正確 檢查連結是否正確"},{"title":"打成績 w8","url":"./da-cheng-ji-w8.html","tags":"Misc","text":"期中課程評量系統 找到自己的學號打下自己覺得的期中成績"},{"title":"SolveSpace W7","url":"./solvespace-w7.html","tags":"Misc","text":"使用SolveSpace的Trace Point計算路徑 40423203 from 40423203 on Vimeo ."},{"title":"子模組問題 W6","url":"./zi-mo-zu-wen-ti-w6.html","tags":"Misc","text":"以為只要再輸入一次指令就可以讓程式抓最新的子模組近來 程式告訴我們還有資料沒刪除乾淨,於是我們再執行一次刪除的指令 然而程式說找不到任何有關該名稱的文件資料,後來我們發現submodule內的設定並沒有也因此刪除,要刪除submodule的設定有兩個方法 一. 從SciTE打開,在2016fallcadp_bg3資料夾內的.gitmodules檔案,把該組員的子模組設定刪除後就可以存檔 二. 直接依序執行git submodule deinit asubmodule git rm asubmodule的指令"},{"title":"介紹SolveSpace w5","url":"./jie-shao-solvespace-w5.html","tags":"Misc","text":"今天用了新的繪圖軟體SolveSpace 不過感覺功能好像不太好使用應該 是還不知道這個軟體有甚麼指令 以後常用鳩會變好了最不習慣 就是標註"},{"title":"建立小組 w4","url":"./jian-li-xiao-zu-w4.html","tags":"Misc","text":"今天老師要組長建一個名為 2016fallcadp_bg3 的小組倉儲之後最內人員都要加進去"},{"title":"網路更改 w3","url":"./wang-lu-geng-gai-w3.html","tags":"Misc","text":"指令:proxy.mde.tw 3128 老師今天教了我們更改網路 更改過後就不用跟大家擠網 路了束度也快了很多"},{"title":"作業2D w2","url":"./zuo-ye-2d-w2.html","tags":"Misc","text":"作業2 心得:用了solvespace跟onshape後我比較習慣oonshape因為他跟我之前學過的軟體很類似所以用起來有熟悉的感覺,而solvespace我比較不太會用,因為它的功能用法太多的限制,如果少了點你的功能就會不能用,還有一點再標註時太過於複雜,但是還是很感謝老師介紹這兩個軟體給我們,我也從中學習很多謝謝."},{"title":"作業 3D w1","url":"./zuo-ye-3d-w1.html","tags":"Misc","text":"作業1 心得:第一次用這個軟體畫圖,有點不太習慣,但有些功能還是蠻方便的,最後靠著團隊的力量還是畫出作品了,錄好影片後因為同學的VIMEO忘記登出所以有些組員就直接上傳了影片,最後就跟他借VIMEO用了,上課時也有開始恢復GITHUB的記憶了開心"}]};